import React from 'react';


export function listing(value) {
    
    const url = 'https://api.pokemontcg.io/v1/cards';
    
    const response = fetch(url)
        .then(response => {
            if (!response.ok) {
                throw new Error();
            }
            return response.json()
        });

    return response;
};
